import React, { Component } from "react";

class WordListContainer extends Component {

    render(){
        const wordArray = [
            wordObject,
            wordObjectTwo
        ]

        const wordObject = {
            word: "Dog",
            type: "Noun",
            category: "Animal",
            difficulty: "Easy"
        }

        const wordObjectTwo = {
            word: "Tree",
            type: "Noun",
            category: "Plant",
            difficulty: "Easy"
        }

        let wordList = wordArray[0].map((item, index) => (
            <li key={index}>{index}:{item}</li>
        ))


        return(
            <div>
                <p>The word is:</p>
                <ul>
                    {wordList}
                </ul>
            </div>
        )
    }
}

export default WordListContainer;

